import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [items, setItems] = useState([]);

  async function fetchData() {
    const res = await fetch('http://localhost:3000');
    res
      .json()
      .then(res => setItems(res))
  }

  useEffect(() => {
    fetchData();
  })

  return (
    <div className="App">
      <p>bonjour</p>
      {items.map(i => <p>{i.title}</p>)}
    </div>
  );
}

export default App;
